def predict(triples: list[Triple]) -> str:
    sentence = ""
    subject = triples[0].subject
    for i, triple in enumerate(triples):
        predicate = triple.predicate
        object_ = triple.object

        if i == 0:
            sentence += f"{subject} "

        if predicate == "author":
            sentence += f"is written by {object_} "
        elif predicate == "isbnNumber":
            sentence += f"has ISBN {object_} "
        elif predicate == "followedBy":
            sentence += f"is followed by {object_} "
        elif predicate == "language":
            sentence += f"is written in {object_} "
        elif predicate == "country":
            country = object_
            sentence += f"is located in {country} "
        elif predicate == "capital":
            sentence += f", whose capital is {object_} "
        elif predicate == "genre":
            sentence += f"is a {object_} "
        else:
            if predicate == "followedBy":
                sentence += f"followed by {object_} "
            elif predicate == "precededBy":
                sentence += f"preceded by {object_} "
            elif predicate == "influencedBy":
                sentence += f"influenced by {object_} "
            elif predicate == "ethnicGroup":
                sentence += f"with an ethnic group of {object_} "
            elif predicate == "language":
                sentence += f"written in {object_} "
            elif predicate == "country":
                sentence += f"located in {object_} "
            elif predicate == "capital":
                sentence += f"whose capital is {object_} "
            elif predicate == "leader":
                sentence += f"led by {object_} "
            elif predicate == "author":
                sentence += f"written by {object_} "
            elif predicate == "genre":
                sentence += f"which is a {object_} "
            else:
                sentence += f"and {predicate} is {object_} "

    return sentence.strip() + "."

